import React from 'react';

export default function AboutEducation() {
  return (
    <section id="about" className="about-edu">
      <div className="about-text">
        <h2>About Me</h2>
        <p>I am a creative and driven software engineer with a passion for developing user‑friendly web applications and robust backend systems.</p>
        <p>My focus is on developing applications that solve real‑world problems and enhance user experiences.</p>
        <p>I believe in continuous learning and strive to stay updated with the latest technologies in the software industry.</p>
      </div>
      <div className="education-card">
        <h3>Education</h3>
        <p>Master of Science in Computer and Information Sciences</p>
        <p>SUNY New Paltz — New Paltz, NY — May 2024</p>
      </div>
    </section>
  );
}
